let i, level=5;

let toolbar = "FF57FF";
let primaryBase = "1e1e1e";
let activeBase = "FF57FF";
let bgBase = "322f31";
let pilotBase = "FF57FF";
let secBase = "DBA4CC";

let primShades = ["light5","light4","light3","light2","light1",primaryBase,"dark1","dark2","dark3","dark4"];
let activeShades = ["light5","light4","light3","light2","light1",activeBase,"dark1","dark2","dark3","dark4"];
let bgShades = ["light5","light4","light3","light2","light1",bgBase,"dark1","dark2","dark3","dark4"];
let pilotShades = ["light5","light4","light3","light2","light1",pilotBase,"dark1","dark2","dark3","dark4"];
let secShades = ["light5","light4","light3","light2","light1",secBase,"dark1","dark2","dark3","dark4"];

for (i=0;i<10;i++){
    primShades[i] = tint(primaryBase,level);
    activeShades[i] = tint(activeBase,level);
    bgShades[i] = tint(bgBase,level);
    pilotShades[i] = tint(pilotBase,level);
    secShades[i] = tint(secBase,level);
    level--;
}

function tint(primCol, level) {
    let red, green, blue, newCol;
    let rgbPrimCol = hexToRGB(primCol).split(",");
    red = Number(rgbPrimCol[0]) + 24*level;
    green = Number(rgbPrimCol[1]) + 24*level;
    blue = Number(rgbPrimCol[2]) + 24*level;
    if (red>255) {
        red = 255;
    }
    if (green>255){
        green = 255;
    }
    if (blue>255){
        blue = 255;
    }
    if (red<0){
        red = 0;
    }
    if (green<0){
        green = 0;
    }
    if (blue<0){
        blue = 0;
    }
    //console.log(red +","+ green +","+ blue);
    newCol = red +","+ green +","+ blue;
    newCol = RGBToHex(newCol);
    return newCol;
}

function hexToRGB(hexcode) {
    let red, green, blue, rgb;
    red = parseInt(hexcode.substring(0, 2), 16);
    green = parseInt(hexcode.substring(2, 4), 16);
    blue = parseInt(hexcode.substring(4), 16);

    rgb = red + "," + green + "," + blue;
    return rgb;
}

function RGBToHex(rbg) {
    let x, hex = "";
    let cols = rbg.split(",");

    for (x=0;x<3;x++){
        //console.log(cols[x]);
        if (Number(cols[x]).toString(16) == 0) {
            hex = hex + "00";
        }
        else if (Number(cols[x]).toString(16).length < 2) {
            hex = hex + 0 + Number(cols[x]).toString(16);
            console.log("new hex is " + hex);
        }
        else {
        hex = hex + Number(cols[x]).toString(16);
        }
    }
    //console.log("new hex is " + hex);
    return hex;
}

